import React from 'react'
import './Navbar.css'

export default function Navbar() {
  return (
    <div className='navbar'>
        <div>
            <img alt='' src='https://uploads-ssl.webflow.com/63a4333d6709521275441c77/63d627c5050b7684adb04fa0_Campus-Activities-Logo.png'></img>
        </div>
        <input type='search' placeholder='Type to search here!'/>
        <button>Login</button>
    </div>
  )
}
